import React from 'react';

class Welcome extends React.Component {

   componentDidMount() {
      this.checkLoginStatus()
   }

   checkLoginStatus() {
      fetch(`http://localhost:3000/api/v1/logged_in`, {
         credentials: 'include'
      })
         .then(res => res.json())
         .then(data => console.log(data))
   }

   render() {
      return (
         <p>Test</p>
      )
   }
}

export default Welcome
